import React from 'react';
import Layout from '../components/MyLayout';

const layoutStyle = {
  margin: 100,
  padding: 5,
  border: '1px solid #DDD'
};

function Resume() {
  return (
    <Layout>
        <div style={layoutStyle}>
          <p>put resume here</p>
        </div>   
    </Layout>
  );
}

export default Resume;
